import React, { useState } from 'react';
import './Buy.css'; // Ensure the Buy.css file is correctly linked

const Buy = () => {
  // State for filters
  const [manufacturer, setManufacturer] = useState('');
  const [model, setModel] = useState('');
  const [kilometers, setKilometers] = useState('');
  const [year, setYear] = useState('');
  const [price, setPrice] = useState('');

  // Dummy data for car listings
  const carListings = [
    { id: 1, manufacturer: 'Volkswagen', model: 'Golf', year: 2020, kilometers: 10000, price: 20000, imgSrc: 'https://via.placeholder.com/150' },
    { id: 2, manufacturer: 'Toyota', model: 'Corolla', year: 2019, kilometers: 15000, price: 18000, imgSrc: 'https://via.placeholder.com/150' },
    { id: 3, manufacturer: 'BMW', model: 'X5', year: 2021, kilometers: 5000, price: 50000, imgSrc: 'https://via.placeholder.com/150' },
  ];

  const filteredCars = carListings.filter(car => {
    return (
      (!manufacturer || car.manufacturer === manufacturer) &&
      (!model || car.model === model) &&
      (!kilometers || car.kilometers <= kilometers) &&
      (!year || car.year === parseInt(year)) &&
      (!price || car.price <= price)
    );
  });

  return (
    <div className="buy-page">
      <div className="filters-section">
        {/* Filter Section */}
        <div className="filters">
          <div className="filter">
            <label>Manufacturer</label>
            <select value={manufacturer} onChange={e => setManufacturer(e.target.value)}>
              <option value="">Any</option>
              <option value="Volkswagen">Volkswagen</option>
              <option value="Toyota">Toyota</option>
              <option value="BMW">BMW</option>
            </select>
          </div>

          <div className="filter">
            <label>Model</label>
            <select value={model} onChange={e => setModel(e.target.value)}>
              <option value="">Any</option>
              <option value="Golf">Golf</option>
              <option value="Corolla">Corolla</option>
              <option value="X5">X5</option>
            </select>
          </div>

          <div className="filter">
            <label>Kilometers</label>
            <input
              type="number"
              value={kilometers}
              placeholder="Max Kilometers"
              onChange={e => setKilometers(e.target.value)}
            />
          </div>

          <div className="filter">
            <label>Year</label>
            <input
              type="number"
              value={year}
              placeholder="Year"
              onChange={e => setYear(e.target.value)}
            />
          </div>

          <div className="filter">
            <label>Price</label>
            <input
              type="number"
              value={price}
              placeholder="Max Price"
              onChange={e => setPrice(e.target.value)}
            />
          </div>
        </div>
      </div>

      {/* Car Listings Section */}
      <div className="car-listings-section">
        <h2>Car Listings</h2>
        <div className="car-listings">
          {filteredCars.length > 0 ? (
            filteredCars.map(car => (
              <div key={car.id} className="car-listing">
                <img src={car.imgSrc} alt={car.model} />
                <div className="car-details">
                  <h3>{car.manufacturer} {car.model}</h3>
                  <p>Year: {car.year}</p>
                  <p>Kilometers: {car.kilometers}</p>
                  <p>Price: ${car.price}</p>
                  <button>View More</button>
                </div>
              </div>
            ))
          ) : (
            <p>No cars found matching your filters.</p>
          )}
        </div>
      </div>
    </div>
  );
};

export default Buy;
